import React from "react";
import { Route, Routes } from "react-router-dom";
import { Link } from "react-router-dom";
import image from "./images/Img.jpeg";
import image2 from "./images/img2.jpg";
import WeatherInfo from "./weather/WeatherInfo";
import Country from "./component1/Country";
import Home from "./component1/Home";
import Thailand from "./component1/Thailand";
import Korea from "./component1/Korea";
import Malaysia from "./component1/Malaysia";

function App() {
  return (
    <div className="main">
      <div className="brand">
        <img src={image} className="logo" />
        <h2>Trip go where </h2>

        <div className="nav-menu">
          <Link to>home</Link>
          <Link to>Destination</Link>
          <Link to>Offer</Link>
          <Link to>Experiences</Link>
          <h1>WishList</h1>
        </div>
      </div>
      <div>
        <div className="title">
          <img src={image2} className="img2"></img>
          <h1>TRAVEL TO EXPLORE</h1>
        </div>
        <div className="search">
          <div className="container">
            <label htmlFor="">where you'd like to go</label>
            <input type="text" placeholder="search your location" />
          </div>
        </div>
        <div className="search">
          <div className="container">
            <label htmlFor="">Check in </label>
            <input type="date" />
          </div>
        </div>
        <div className="search">
          <div className="container">
            <label htmlFor="">Check out</label>
            <input type="date" />
          </div>
          <button>explore Now</button>
        </div>
      </div>
      <div>
        <WeatherInfo />
      </div>

      <Routes>
        <Route path="thailand" element={<Thailand />} />

        <Route path="korea" element={<Korea />} />

        <Route path="malaysia" element={<Malaysia />} />
      </Routes>

      <Home />
      <Country />
    </div>
  );
}
